import classesMain from "./Main.module.css";
import Divider from "./Divider";

const Contact = () => {
  return (
    <>
      <div>
        <h1 className={classesMain.subTitle}>CONTACT</h1>
        <Divider color="black" />
      </div>
    </>
  );
};

export default Contact;
